import React, { useState } from 'react';
import { Nav } from 'react-bootstrap';
import logo from './logo.svg';
import './App.css';

function App() {
  var [username, usernamedata] = useState(['호랑이', '사자']);
  var [nav, nav2] = useState(['Todo List', 'Done List']);

  function title(i) {
    return (
      <div>
        <div class="title">
          <h2>{nav[i]}</h2>
        </div>
      </div>
    )
  }


  return (
    <div>
      <Nav variant="pills" defaultActiveKey="/home">
        <Nav.Item>
          <Nav.Link href="/home" onClick={title[0]}>{nav[0]}</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-1" onClick={title[1]}>{nav[1]}</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="disabled" disabled>{username[0]}님 저장소</Nav.Link>
        </Nav.Item>
      </Nav>

      <List />

    </div>
  );
}


function List() {
  return (
    <div>
      <div class="input-box">
        <input id="input" type="text" placeholder="할 일을 입력하세요." /><button id="add">+</button>
      </div>
      <div class="list">
        <ul id="to-do-list"></ul>
      </div>
    </div>
  )
}

export default App;
